import React, { useState } from 'react';
import axios from 'axios';

const SmartPasscodeForm = ({ leases, users, onCreated }) => {
  const [leaseId, setLeaseId] = useState('');
  const [userId, setUserId] = useState('');
  const [expiresAt, setExpiresAt] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    const lease_id = Number(leaseId);
    const user_id = Number(userId);

    if (!lease_id || !user_id) {
      setError('Please select a valid lease and user.');
      return;
    }

    try {
      const res = await axios.post(
        '/api/smart-passcodes',
        { lease_id, user_id, expires_at: expiresAt || null },
        { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } }
      );

      onCreated(res.data.passcode);

      setLeaseId('');
      setUserId('');
      setExpiresAt('');
      setSuccess('Passcode generated successfully!');
    } catch (err) {
      console.error(err);
      setError('Failed to generate passcode. Try again.');
    }
  };

  return (
    <form onSubmit={handleSubmit} style={styles.form}>
      <h3 style={styles.title}>Generate Smart Passcode</h3>

      <div style={styles.row}>
        {/* Lease Dropdown */}
        <div style={styles.field}>
          <label style={styles.label}>Lease</label>
          <select
            style={styles.select}
            value={leaseId}
            onChange={(e) => setLeaseId(e.target.value)}
          >
            <option value="" disabled>Select Lease</option>
            {leases
              .filter(l => l.lease_id)
              .sort((a, b) => a.lease_id - b.lease_id)
              .map(l => (
                <option key={l.lease_id} value={l.lease_id}>
                  Lease #{l.lease_id} â€“ Property {l.property_id}
                </option>
              ))}
          </select>
        </div>

        {/* User Dropdown */}
        <div style={styles.field}>
          <label style={styles.label}>User</label>
          <select
            style={styles.select}
            value={userId}
            onChange={(e) => setUserId(e.target.value)}
          >
            <option value="" disabled>Select User</option>
            {users
              .filter(u => u.user_id)
              .sort((a, b) => a.user_id - b.user_id)
              .map(u => (
                <option key={u.user_id} value={u.user_id}>
                  {u.name || `User #${u.user_id}`}
                </option>
              ))}
          </select>
        </div>
      </div>

      {/* Expiry */}
      <div style={styles.field}>
        <label style={styles.label}>Expiry (Optional)</label>
        <input
          type="datetime-local"
          style={styles.input}
          value={expiresAt}
          onChange={(e) => setExpiresAt(e.target.value)}
        />
      </div>

      <button type="submit" style={styles.button}>
        Generate Passcode
      </button>

      {error && <div style={styles.error}>{error}</div>}
      {success && <div style={styles.success}>{success}</div>}
    </form>
  );
};

const styles = {
  form: {
    background: '#fff',
    padding: '1.8rem',
    borderRadius: '14px',
    boxShadow: '0 4px 14px rgba(0,0,0,0.08)',
    display: 'flex',
    flexDirection: 'column',
    gap: '1.4rem'
  },
  title: {
    fontSize: '1.25rem',
    fontWeight: '600',
    marginBottom: '0.2rem'
  },
  row: {
    display: 'flex',
    gap: '1rem',
    flexWrap: 'wrap'
  },
  field: {
    flex: 1,
    minWidth: '200px',
    display: 'flex',
    flexDirection: 'column'
  },
  label: {
    marginBottom: '0.4rem',
    fontWeight: '500',
    fontSize: '0.9rem',
    color: '#333'
  },
  select: {
    padding: '0.55rem',
    borderRadius: '8px',
    border: '1px solid #d1d1d1',
    fontSize: '0.95rem',
    backgroundColor: '#fff',
    cursor: 'pointer',
    transition: '0.2s'
  },
  input: {
    padding: '0.55rem',
    borderRadius: '8px',
    border: '1px solid #d1d1d1',
    fontSize: '0.95rem'
  },
  button: {
    padding: '0.7rem 1.4rem',
    backgroundColor: '#007bff',
    border: 'none',
    color: '#fff',
    borderRadius: '8px',
    cursor: 'pointer',
    fontWeight: '600',
    fontSize: '1rem',
    width: 'fit-content',
    transition: '0.2s'
  },
  error: {
    color: '#e74c3c',
    fontWeight: '500'
  },
  success: {
    color: '#2ecc71',
    fontWeight: '500'
  }
};

export default SmartPasscodeForm;
